import React from 'react'
import Card from './Card'
import AAddCard from './AAddCard'
import './card.css'


export default function CardsList({ mesCards, handleAddCards }) {

    return (

        <div>
            <div className='movie-list'>
                {mesCards.map(card => (
                    <Card
                        title={card.cardTitle}
                        // image={card.image}
                        description={card.description}
                    // rate={card.rate}
                    />
                ))}
            </div>
            <AAddCard handleAddCards={handleAddCards} />
        </div>
    )
}
